import clothing from "./Images/clothing.png"
import electronics from "./Images/electronics.png"
import jewelery from "./Images/jewelery.png"
import { Link } from 'react-router-dom'


class Home extends React.Component {

    constructor() {
        super()

        this.state = {
          products: []
        }
      }

    render() {
        //console.log('prod',this.props.products)
        return (

            <div className="home-menu" key={"home"}>
                <div ClassName={HomeStyle.menclothing}>
                    <Link to='/menclothing'
                            ClassName={HomeStyle.image1}
                            src={clothing}
                            alt="Clothing"
                    >Men's Clothing</Link>
                </div>

                <div ClassName={HomeStyle.womenclothing}>
                    <Link to='/womenclothing'
                            ClassName={HomeStyle.image11}
                            src={clothing}
                            alt="Clothing"
                    >Women's Clothing</Link>
                </div>

                <div ClassName={HomeStyle.electronics}>
                    <Link to='/electronics'
                            ClassName={HomeStyle.image2}
                            src={electronics}
                            alt="Electronics"
                    >Electronics</Link>
                </div>

                <div ClassName={HomeStyle.jewelery}>
                    <Link   to='/jewelery'
                            className={HomeStyle.image3}
